const float zFar  = 400.0;

float hash21(vec2 p) { //shadertoy.com/view/4djSRW
	vec3 p3  = fract(vec3(p.xyx) * .1031);
    p3 += dot(p3, p3.yzx + 33.33);
    return fract((p3.x + p3.y) * p3.z);
}

float fade(float f) {
    return f*f*f*(f*(f*6.-15.)+10.);    
}

float randAngle(vec2 v) {
    return hash21(v)*6.2832;
}

vec2 grad(float rand) {
    return vec2(cos(rand), sin(rand)) * 1.4142;
}

float perlin(vec2 uv) {

    vec2 index0 = floor(uv);
    vec2 index1 = index0 + vec2(1,0);
    vec2 index2 = index0 + vec2(1,1);
    vec2 index3 = index0 + vec2(0,1);

    float rand0 = hash21(index0)*6.2832;
    float rand1 = hash21(index1)*6.2832;
    float rand2 = hash21(index2)*6.2832;
    float rand3 = hash21(index3)*6.2832;

    vec2 localCoords = fract(uv);

    float d0 = dot(uv - index0, grad(rand0));
    float d1 = dot(uv - index1, grad(rand1));
    float d2 = dot(uv - index2, grad(rand2));
    float d3 = dot(uv - index3, grad(rand3));

    vec2 lerp = vec2(fade(localCoords.x), fade(localCoords.y));

    float hlerp1 = mix(d0, d1, lerp.x);
    float hlerp2 = mix(d3, d2, lerp.x);    

    return mix(hlerp1, hlerp2, lerp.y);
}

float sdHeightField(vec3 m, out float height) {
    float h1 = perlin(m.xz*0.1);
    float h2 = perlin(m.xz*0.1) * 5.;
    /*if (h1+h2 < -2.0) {
        height = h1 + h2;
        return m.y +2.;
    }*/
    height = h1+h2;
    return m.y - (h1+h2);
}

float sdBox( vec3 p, vec3 b )
{
  vec3 q = abs(p) - b;
  return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0);
}

// IQ func <3
vec3 computeNormal(in vec3 pos)
{
    float height;
	vec3 eps = vec3( 0.001, 0.0, 0.0 );
	vec3 nor = vec3(
	     sdHeightField(pos+eps.xyy,height) - sdHeightField(pos-eps.xyy,height),
	    sdHeightField(pos+eps.yxy,height) - sdHeightField(pos-eps.yxy,height),
	    sdHeightField(pos+eps.yyx,height) - sdHeightField(pos-eps.yyx,height));
	return normalize(nor);
}

float map(vec3 m, out float height, out bool isCar, vec3 carposition, out vec4 color) {
    vec3 norm = computeNormal(carposition);
    float carheight;
    sdHeightField(carposition, carheight);
    carposition.y = carheight;

    vec3 ww =     vec3(1,0,0);
    vec3 uu =     norm;
    vec3 vv =    normalize(cross(vec3(norm), vec3(1,0,0)));
    ww = normalize(cross(uu, vv));

    mat3 test = mat3(
        ww,
        uu,
        vv
    );

    float distcar = sdBox(test * (m-norm- carposition), vec3(1,1,1));

    float distmap = sdHeightField(m, height);
    if (distmap < distcar) {
        color = texelFetch(iChannel0, ivec2(mod(m.x,128.0),mod(m.z, 128.0)),0);
        isCar = false;
        return distmap;
    } else {
        isCar = true;
        return distcar;
    }
}

