bool rayMarching(in vec3 origin, in vec3 ray, out float height, out bool isCar, vec3 carposition, out vec4 color, out vec3 m) {
    float	marchingDist = 0.0;
    float 	nbIter 		 = 0.0;
    for(int i = 0; i<200; i++) {
        m = origin + ray * marchingDist;    
    	float dist = map(m, height, isCar, carposition, color);
        if(dist < 0.01) {
            return true;
        }
        else {
            marchingDist += dist * 0.4;
            if(marchingDist >= zFar) {
                break;
            }
        }
    }
	return false;    
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = (fragCoord - 0.5*iResolution.xy)/iResolution.x;

    vec3 carpositionold = vec3(60,0,60) + vec3(50.0*sin((iTime-0.1)*0.1),0,30.0*cos((iTime-0.1)*0.4));
    vec3 carposition = vec3(60,0,60) + vec3(50.0*sin(iTime*0.1),0,30.0*cos(iTime*0.4));
    vec3 dir = normalize(carpositionold - carposition);

    vec3 origin = carposition+vec3(0,30,0)+dir*20.0;//+vec3(0,10,10);//vec3(0.0,5,-10.0);
    vec3 target = carposition;
    vec3 up = vec3(0,1,0);

    vec3 ww = normalize( target - origin );
    vec3 uu = normalize( cross(ww,up ) );
    vec3 vv = cross(uu,ww);
    vec3 rd = normalize( uv.x*uu + uv.y*vv + ww );

    vec3 light = normalize(vec3(cos(iTime)*10.0,-10,sin(iTime)*10.0));

    vec3 m;
    float height;
    bool isCar;
    vec4 color;
    if(rayMarching(origin, rd, height, isCar, carposition, color, m)) {
        if (isCar) {
            fragColor = vec4(1,0,0,1);
        } else {
            vec3 norm = computeNormal(m);

            float factor = max(0.0, min(1.0, dot(norm, -light)));

            vec4 color1;
            if (height <= -1.0) {
                float test = height + 4.0;
                float factor = test / 2.0;
                color1 = mix(vec4(0,0,1,1), vec4(0.5,0.5,1,1), height+2.0);
            } else if (height > -1.0 && height <= 0.5) {
                color1 = mix(vec4(1,1,0,1), vec4(0,1,0,1), (height+1.0) / 1.5);
            } else if (height > 0.5 && height <= 1.0) {
                color1 = mix(vec4(0,1,0,1), vec4(199.0/255.0, 149.0/255.0, 80./255.0,1), (height-0.5)/0.5);
            } else if (height > 1.0 && height <= 1.5) {
                color1 = mix(vec4(199.0/255.0, 149.0/255.0, 80./255.0, 1.0), vec4(1,1,1,1), (height-1.0)/0.5);
            } else {
                color1 = vec4(1,1,1,1);
            }

            fragColor = factor * mix(color, color1,(1.0+cos(iTime*0.1))/2.0);//vec4(1,0,0,1.0);
       }
    } else {
        fragColor = vec4(0.4,0.4,0.8,1);
    }
}
